def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    min_path = [float('inf')] * k

    def dfs(x, y, cur_len, cur_path):
        nonlocal min_path
        if cur_len == k:
            min_path = min(min_path, cur_path)
            return
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                dfs(nx, ny, cur_len + 1, cur_path + [grid[nx][ny]])

    for i in range(N):
        for j in range(N):
            dfs(i, j, 1, [grid[i][j]])

    return min_path

